import React, { useState } from 'react';
import { useConnect } from "@stacks/connect-react";
import { StacksMocknet } from "@stacks/network";
import { 
  AnchorMode, 
  principalCV, 
  uintCV, 
  tupleCV, 
  FungibleConditionCode,
  makeStandardSTXPostCondition 
} from "@stacks/transactions";
import { userSession } from "./ConnectWallet";

const ListingForm = () => {
  const { doContractCall } = useConnect();

  const [tokenId, setTokenId] = useState('');
  const [expiry, setExpiry] = useState('');
  const [price, setPrice] = useState('');

  const postConditionAddress = userSession.loadUserData().profile.stxAddress.testnet;
  const postConditionCode = FungibleConditionCode.LessEqual;
  const postConditionAmount = 50 * 1000000;

  const handleSubmit = async (e) => {
    e.preventDefault();

    // Basic validation
    if (!tokenId || !expiry || !price) {
      window.alert("Please fill in all fields.");
      return;
    }

    doContractCall({
      network: new StacksMocknet(),
      anchorMode: AnchorMode.Any,
      contractAddress: "ST1PQHQKV0RJXZFY1DGX8MNSNYVE3VGZJSRTPGZGM", // Contract address
      contractName: "tiny-market", // Contract name
      functionName: "list-asset",
      functionArgs: [
        principalCV("ST1PQHQKV0RJXZFY1DGX8MNSNYVE3VGZJSRTPGZGM.sip009-nft"), // NFT asset contract principal
        tupleCV({
          'token-id': uintCV(parseInt(tokenId)),
          'expiry': uintCV(parseInt(expiry)),
          'price': uintCV(parseInt(price)),
        }),
      ],
      postConditions: [
        makeStandardSTXPostCondition(
          postConditionAddress,
          postConditionCode,
          postConditionAmount
        )
      ],
      onFinish: (data) => {
        console.log("onFinish:", data);
        window.alert("Asset listed successfully!");
        // Clear the input fields by resetting the state
        setTokenId('');
        setExpiry('');
        setPrice('');
      },
      onCancel: () => {
        console.log("onCancel:", "Transaction was canceled");
        window.alert("Asset listing failed.");
      },
      onError: (error) => {
        // Log and handle errors
        console.error("Error during contract call:", error);
        window.alert("An error occurred while listing the asset. Please try again.");
      }
    });
  };

  return (
    <form onSubmit={handleSubmit}>

      <div>
        <label htmlFor="token-id">NFT Token ID:</label>
        <input
          type="number"
          id="token-id"
          value={tokenId}
          onChange={(e) => setTokenId(e.target.value)}
          required
        />
      </div>

      <div>
        <label htmlFor="expiry">Expiry Block Height:</label>
        <input
          type="number"
          id="expiry"
          value={expiry}
          onChange={(e) => setExpiry(e.target.value)}
          required
        />
      </div>

      <div>
        <label htmlFor="price">Price:</label>
        <input
          type="number"
          id="price"
          value={price}
          onChange={(e) => setPrice(e.target.value)}
          required
        />
      </div>

      <div class="container">
            <h1>Sell or Swap</h1>
            <div class="nft-details">
                <div class="nft-image">
                    <img src="stacks.png" alt="NFT Image" id="nftImage"/>
                </div>
                <div class="nft-form">
                    <h2 id="nftName">NFT Name</h2>
                    <form id="sellForm">
                        <div class="form-group">
                            <label for="sellMethod">Sell Method</label>
                            <select id="sellMethod" name="sellMethod">
                                <option value="sell">Sell</option>
                                <option value="swap">Swap</option>
                            </select>
                        </div>
                        <div class="form-row">
                            <div class="form-group">
                                <label for="sellPrice">Sell Price</label>
                                <input type="text" id="sellPrice" name="sellPrice" placeholder="0.00 BTC"/>
                            </div>
                            <div class="form-group">
                                <label for="swapNFT">Swap</label>
                                <button type="button" id="swapNFT" disabled>Choose NFT</button>
                            </div>
                        </div>
                        <div class="form-row">
                            <div class="form-group">
                                <label for="expiryDate">Expiry Date</label>
                                <select id="timePeriod" name="expiryDate">
                                    <option value="1">1 hour</option>
                                    <option value="12">12 hours</option>
                                    <option value="24">1 day</option>
                                    <option value="72">3 days</option>
                                    <option value="168">7 days</option>
                                    <option value="744">31 days</option>
                                </select>
                            </div>
                        </div>
                        <button type="submit">Continue</button>
                    </form>
                </div>
            </div>
            
        </div>

      <button type="submit">List Asset</button>
    </form>
  );
};

export default ListingForm;
